import React from 'react';
import jamBookerLogo from '../../assets/logo.jpg';
import './logo.css';
import {NavLink} from 'react-router-dom';

const logo = () => (
    <div className='logo'>
          <img src={jamBookerLogo} alt="MyBurger"/>
    </div>
);

export default logo;
